from tmk.dummy.dummyData import DummySectionData
from tmk.util.generator import CMPGeneric, FileGenerate
from tmk.util.functions import loadConfiguration, loadEnvironment

class SectionFragment:
    def __init__(self, dataSource=DummySectionData(), config=None, environment=None):
        '''
        Constructor
        '''
        self.ds = dataSource
        self.id = dataSource.getTMKId()
        if (config != None):
            self.cfg = config
        else:
            self.cfg = loadConfiguration(self.id.getCfgFilePath())
        if (environment != None):
            self.env = environment
        else:
            self.env = loadEnvironment(self.cfg['tplDocBase'])
        
    def generateJSComments(self):
        jsComments = CMPGeneric(self.env, self.cfg['tplSectionComments']).generate({'comments_data' : self.ds.getCommentsData(), 'site_domain': self.cfg['siteDomain']})
        FileGenerate(self.cfg['outDir'] + self.id.getURL() + self.cfg['section-comments-file']).generate(jsComments)
        return
    

    def generateJSShowCase(self):
        jsShowCase= CMPGeneric(self.env, self.cfg['tplSectionShowCase']).generate({'showcase_data' : self.ds.getShowCaseData()})
        FileGenerate(self.cfg['outDir'] + self.id.getURL() + self.cfg['section-showcase-file']).generate(jsShowCase)
        return
    
    def generateJSToolTip(self):
        jsToolTip = CMPGeneric(self.env, self.cfg['tplSectionToolTip']).generate({'tooltip_data' : self.ds.getShowCaseData()})
        FileGenerate(self.cfg['outDir'] + self.id.getURL() + self.cfg['section-tooltip-file']).generate(jsToolTip)
        return 
        
    def generateJSRelated(self):
        jsRelated = CMPGeneric(self.env, self.cfg['tplSectionRelated']).generate({'related_data' : self.ds.getRelatedData()})
        FileGenerate(self.cfg['outDir'] + self.id.getURL() + self.cfg['section-related-file']).generate(jsRelated)
        return
        
    def getMenuData(self):
        menuData = {
            "secciones" : [{"idSeccion" : "seccion4"}, {"idSeccion" : "seccion5"}, {"idSeccion" : "seccion3"}, {"idSeccion" : "seccion200"}, {"idSeccion" : "seccion300"}, {"idSeccion" : "seccion400"}]
            }
        return menuData
    def getSearchData(self):
        searchOpts = {
            "options": [
                     {
                        "idOpt" : "optBus1",
                        "txtOpt" : "Todo el Sitio",
                        "idSeccion" : self.cfg['SECCION_HOME'],
                        "seccionBusqueda" : "En Tematika.com",
                        "idSeccionPropia" : self.cfg['SECCION_HOME'],
                        "urlBus" : "/buscador/productos.jsp?idSeccion=" + str(self.cfg['SECCION_HOME'])
                    }, {
                        "idOpt" : "optBus2",
                        "txtOpt" : "En Libros",
                        "idSeccion" : self.cfg['SECCION_LIBRO'],
                        "seccionBusqueda" : "En Libros",
                        "idSeccionPropia" : self.cfg['SECCION_LIBRO'],
                        "urlBus" : "/buscador/productos.jsp?idSeccion=" + str(self.cfg['SECCION_LIBRO'])
                    }
                          ]
            }
        return searchOpts  
    
